import "./Login.css";

import React, { Component } from "react";

class Login extends Component {
  constructor(props) {
    super(props);

    this.state = {
      name: "",
      email: "",
      password: "",
    };
  }

  render() {
    return (
      <div>
        <img
          src="https://www.logo.wine/a/logo/LinkedIn/LinkedIn-Logo.wine.svg"
          alt="linkedin logo"
        />
      </div>
    );
  }
}

export default Login;
